window.bookSummaryJSON = "<p>The world of man was brought to its knees with the zombie apocalypse. A hundred and fifty years have passed since man clawed and climbed his way back from the brink of extinction. Civilization has rebooted, man has begun to rebuild, creating new communities and society. It is on this fragile new shaky ground that a threat worse than the scourge of the dead has sprung... </p> <p> Once again, one man finds himself once thrust into the forefront of a war he wants nothing to do with and seemingly cannot win. Follow along as Michael Talbot attempts to thwart the rise of the werewolf...</p>"; 
